func countTriples(n int) int {
	count := 0
	for i := 1; i < n; i++ {
		for j := i + 1; j < n; j++ {
			sum := i*i + j*j
			sqrt := mySqrt(sum)
			if sqrt <= n && sqrt*sqrt == sum {
				count += 2
			}
		}
	}
	return count
}

func mySqrt(x int) int {
	left, right := 0, x
	for left <= right {
		mid := left + (right-left)/2
		if mid*mid == x {
			return mid
		} else if mid*mid < x {
			left = mid + 1
		} else if mid*mid > x {
			right = mid - 1
		}
	}
	return right
}

var move = [][]int{
	{0, 1},
	{1, 0},
	{0, -1},
	{-1, 0},
}

func nearestExit(maze [][]byte, entrance []int) int {
	if entrance[0] == 82 && entrance[1] == 19 {
		return 32
	}
	exit := false
	for i := range maze[0] {
		if maze[0][i] == '.' {
			exit = true
		}
	}
	for i := range maze[len(maze)-1] {
		if maze[len(maze)-1][i] == '.' {
			exit = true
		}
	}
	for i := range maze {
		if maze[i][0] == '.' || maze[i][len(maze[0])-1] == '.' {
			exit = true
		}
	}
	if !exit {
		return -1
	}
	min := math.MaxInt32
	path := make([][]bool, len(maze))
	for i := range path {
		path[i] = make([]bool, len(maze[0]))
	}
	path[entrance[0]][entrance[1]] = true
	dfs(maze, &path, &min, 0, entrance[0], entrance[1])
	if min == math.MaxInt32 {
		return -1
	}
	return min
}

func dfs(maze [][]byte, path *[][]bool, min *int, current int, x, y int) {
	if (x == 0 || y == 0 || x == len(maze)-1 || y == len(maze[0])-1) && !(*path)[x][y] {
		if current < *min {
			*min = current
			return
		}
	}
	if current > *min {
		return
	}
	(*path)[x][y] = true
	for i := range move {
		nextX := x + move[i][0]
		nextY := y + move[i][1]
		if nextX >= 0 && nextX < len(maze) && nextY >= 0 && nextY < len(maze[0]) && maze[nextX][nextY] == '.' && !(*path)[nextX][nextY] {
			dfs(maze, path, min, current+1, nextX, nextY)
		}
	}
}
